import React from 'react';
import { motion, AnimatePresence } from "framer-motion"

function AppAnimate() {
    return (
<AnimatePresence>
    <motion.img
      key={image.src}
      src={image.src}
      initial={{ opacity: 0, y: 200 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
    />
  </AnimatePresence>


        );
    }

    export default AppAnimate;
